(9262, 2016, '16197', 'SANTOS OVIDIO', 'HERNANDEZ ZAMBRANO', '', 'PANAMA', 'M', '1992-08-26', 'PANAMÁ', '', 'COMUNIDAD EL NARANJAL, DISTRITO DE SAN FRANCISCO PROVINCIA DE VERAGUAS, REPÚBLICA DE PANAMÁ.', 'santovidio102@hotmail.com', '', '', '68769346', '0', '', '0777', 'World Vision-Honduras', 'Fue una experiencia gratificante ya que estuve involucrado en un proyecto denominado “Generación de Oportunidades Económicas para los jóvenes en riesgos y sus familias (G.E.O) desarrollados en los municipios de San Francisco del Valle, San Marcos, Sensenti y Mercedes en Ocotepeque Honduras. El proyecto contemplaba el involucramiento a los jóvenes en un 70% el resto lo conformaban los padres de familia; el cual tenía como objetivo principal desarrollar oportunidades económicas en ámbitos de mercado, agricultura, talento humano, microempresas, etc  incentivando a los jóvenes a hacer agentes de cambios en sus propias aldeas o comunidades y que no se vieran la necesidad de inmigrar a los Estados Unidos. En el tema de agricultura se desarrollaban Escuelas de Campo (ECAS) donde se les brindaba la oportunidad a los jóvenes de conocer cada eslabón desde la limpieza y preparación del suelo demostrado en campo en un área de una manzana aproximadamente hasta el mercadeo de los productos de gran v', '', 'Estudio de factibilidad para la producción de cebolla (Allium cepa L) en Zamorano, Honduras', 'Ing. Rommel Reconco', 'https://bdigital.zamorano.edu/bitstream/11036/5835/1/AGN-2016-T024.pdf', 'Banca Agropecuaria, Extensionista Agrícola y Pecuario.', 'Otras Entidades', 'Banco Nacional de Panamá', '', '', 'ADMINISTRACION DE AGRONEGOCIOS', 0, '0000-00-00', 'G2', '', 0, '3', '12', 0),
